// CardsContainer, ResultCard and NoResultCard components
// card to hold a found place's search result details
import React from "react";
import "./style.css";


// ===================================================================
// cards CONTAINER
// ===================================================================

export function CardsContainer({ fluid, children }) {
  return (
  <div 
    className="container"
    style={{ height: "100%", clear: "both", paddingTop: 120, textAlign: "center" }}
    >
    {children}
  </div>
  );
}

// ===================================================================
// SEARCH RESULTS card
// ===================================================================

export function ResultCard({ children }) {
  return (
    <>
      <div className='card border-dark mb-3'>
        <h1>Monkeypants!</h1>
      </div>
    </>
  );
}

// ===================================================================
// NO RESULTS card
// ===================================================================

export function NoResultCard({ children }) {
  return (
    <div
    // style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
    // className="jumbotron"
    >
      {children}
    </div>
  );
}
